import React, {useState} from 'react';
import data from "../restaurant-menu.json";


function Lunch() {
    const [menu] = useState(data.array.categorys[2]["menu-items"]);
    console.log(menu[0])
    return (
        <div className="Card">



            <ul>
                {menu.map((item)=>{
                    return(
                        <li key={item.id}>
                            <div>
                                <img src={item.images} alt =""/>
                                <h4>{item.name}</h4>
                                <p>{item.description}</p>
                                <ul>
                                    {item["sub-items"].map((value)=>{
                                    return(
                                        <li key={value.id}>
                                        <p>{item.price}</p>
                                    </li>
                                    )
                                })}
                                </ul>
                            </div>
                        </li>
                    );
                })}
            </ul>

        </div>


    )
}

export default Lunch
